// src/components/ResultPanel.js
import React from 'react';

const ResultPanel = ({ errorCount, elapsedTime, onSubmitAgain }) => {
  const errorRate = (errorCount / elapsedTime) * 100;

  return (
    <div>
      <h2>Results</h2>
      <p>Error Count: {errorCount}</p>
      <p>Elapsed Time: {elapsedTime} seconds</p>
      <p>Error Rate: {errorRate.toFixed(2)}%</p>
      <button onClick={onSubmitAgain}>Play Again</button>
    </div>
  );
}

export default ResultPanel;
